def modulate(bits, modulation_order=16):
    bits = bits.astype(np.uint8)
    M = int(np.log2(modulation_order))
    indices = np.zeros((bits.size // M,), dtype=np.uint8)
    for i in range(M):
        indices += 2**i * bits[M-i-1::M]
    return modulations[modulation_order][indices]

